import React, { useState } from "react";
import { Card, CardContent, CardHeader, CardTitle } from "@/components/ui/card";
import { Button } from "@/components/ui/button";
import { Input } from "@/components/ui/input";
import { Label } from "@/components/ui/label";
import { AlertCircle, Check, UserPlus } from "lucide-react";
import { Alert, AlertDescription } from "@/components/ui/alert";
import { Dialog, DialogContent, DialogHeader, DialogTitle } from "@/components/ui/dialog";

const RegistroUsuarioModal = () => {
  const [visible, setVisible] = useState(false);
  const [showSuccess, setShowSuccess] = useState(false);
  const [showError, setShowError] = useState(false);
  const [formData, setFormData] = useState({
    cedula: "",
    nombre: "",
    primerApellido: "",
    segundoApellido: "",
    direccion: "",
    telefono: "",
    correoElectronico: "",
    contrasena: "",
  });

  const handleInputChange = (e) => {
    const { name, value } = e.target;
    setFormData({ ...formData, [name]: value });
  };

  const handleSubmit = () => {
    if (Object.values(formData).some((value) => value.trim() === "")) {
      setShowError(true);
      setTimeout(() => setShowError(false), 3000);
      return;
    }

    console.log("Datos enviados:", formData);

    setFormData({
      cedula: "",
      nombre: "",
      primerApellido: "",
      segundoApellido: "",
      direccion: "",
      telefono: "",
      correoElectronico: "",
      contrasena: "",
    });

    setShowSuccess(true);
    setTimeout(() => {
      setShowSuccess(false);
      setVisible(false);
    }, 2000);
  };

  const InputField = ({ id, label, type = "text", ...props }) => (
    <div className="mb-4">
      <Label htmlFor={id} className="block text-sm font-medium mb-2 text-gray-700">
        {label}
      </Label>
      <Input
        id={id}
        type={type}
        className="w-full p-2 border rounded-lg focus:ring-2 focus:ring-teal-500 focus:border-teal-500"
        {...props}
      />
    </div>
  );

  return (
    <div className="max-w-4xl mx-auto p-4">
      {showSuccess && (
        <Alert className="mb-4 bg-teal-50 border-teal-200">
          <Check className="h-4 w-4 text-teal-500" />
          <AlertDescription className="text-teal-700">
            Usuario registrado exitosamente
          </AlertDescription>
        </Alert>
      )}

      {showError && (
        <Alert className="mb-4 bg-red-50 border-red-200">
          <AlertCircle className="h-4 w-4 text-red-500" />
          <AlertDescription className="text-red-700">
            Por favor complete todos los campos
          </AlertDescription>
        </Alert>
      )}

      <Button 
        onClick={() => setVisible(true)}
        className="bg-teal-600 hover:bg-teal-700 text-white transition-colors"
      >
        <UserPlus className="mr-2 h-4 w-4" />
        Registrar Usuario
      </Button>

      <Dialog open={visible} onOpenChange={setVisible}>
        <DialogContent className="max-w-2xl">
          <DialogHeader>
            <DialogTitle className="text-2xl font-semibold text-teal-800 mb-4">
              Registro de Usuario
            </DialogTitle>
          </DialogHeader>

          <div className="grid gap-4 py-4">
            <InputField
              id="cedula"
              name="cedula"
              label="Cédula"
              value={formData.cedula}
              onChange={handleInputChange}
            />
            <InputField
              id="nombre"
              name="nombre"
              label="Nombre"
              value={formData.nombre}
              onChange={handleInputChange}
            />
            <InputField
              id="primerApellido"
              name="primerApellido"
              label="Primer Apellido"
              value={formData.primerApellido}
              onChange={handleInputChange}
            />
            <InputField
              id="segundoApellido"
              name="segundoApellido"
              label="Segundo Apellido"
              value={formData.segundoApellido}
              onChange={handleInputChange}
            />
            <InputField
              id="direccion"
              name="direccion"
              label="Dirección"
              value={formData.direccion}
              onChange={handleInputChange}
            />
            <InputField
              id="telefono"
              name="telefono"
              label="Teléfono"
              value={formData.telefono}
              onChange={handleInputChange}
            />
            <InputField
              id="correoElectronico"
              name="correoElectronico"
              label="Correo Electrónico"
              type="email"
              value={formData.correoElectronico}
              onChange={handleInputChange}
            />
            <InputField
              id="contrasena"
              name="contrasena"
              label="Contraseña"
              type="password"
              value={formData.contrasena}
              onChange={handleInputChange}
            />

            <Button
              onClick={handleSubmit}
              className="w-full bg-teal-600 hover:bg-teal-700 text-white transition-colors mt-4"
            >
              <Check className="mr-2 h-4 w-4" />
              Registrar
            </Button>
          </div>
        </DialogContent>
      </Dialog>
    </div>
  );
};

export default RegistroUsuarioModal;
